import './App.css';
import {BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'
import React from 'react';

function App() {
  return (
    <>
    <BrowserRouter>
     <Routes>
        <Route exact path='/' >
        <React.Fragment>
          <Navbar />

        </React.Fragment>
        </Route>
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
